import styled from "styled-components";


export const StyledNav = styled.nav`
    background: black;
    color: blue;
    height: 50px;
    margin-top: -25px;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 5rem;
    position: sticky;
    top:0
    z-index: 10;
    



`
export const StyledNavLogo = styled.nav`
    background: black;
    color: red;
    height: 80px;
    margin-top: -15px;
    display: flex;
    justify-content: left;
    align-items: center;
    font-size: 1rem;
    position: sticky;
    top:0
    z-index: 10;
    padding: 0 20px;
`
